import React, { Component } from 'react';
import $ from 'jquery';
import { Button } from 'reactstrap';

class SearchResults extends Component {
    // componentDidMount(){
    //     $('img').click(function(){
    //         $('.selected').removeClass('selected'); 
    //         $(this).addClass('selected'); 
    //      });
    // }
    handleClick(){
        $('img').click().toggleClass("unchecked-border");
    }




    render(){
        const searchResultsList = this.props.images.map((image, i) => {
            return(
                <div className="image-options" key={i}>
                <img className="unchecked-border" onClick={ () => this.props.handleImageClick(image) } alt="" src={ image } id={i}/>
                </div>
            )
        })
        return(
            <div>
            { searchResultsList }
            </div>
        )
    }
}

export default SearchResults;
